    setTitle('');
  }

  const listenInput =(event)=>{
    setTitle(event.target.value);
  }



  return (
    <form onSubmit={collData}>
      <input type="text" value={title} onChange={listenInput}></input>
      <button type="submit">OK GO</button>
    </form>
  );
};

export default formSumbit;
